  Code = "class Solution:\n    def numberOfPairs(self, nums1: List[int], nums2: List[int], k: int) -> int:\n        freqs = [0] * 51\n        for i in range(len(nums2)):\n            freqs[nums2[i]] += 1\n        res = 0\n        for i in range(len(nums1)):\n            for num2 in range(1, len(freqs)):\n                if nums1[i] % (num2 * k) == 0:\n                    res += freqs[num2]\n        return res"
